import React, {useState, useEffect} from "react";// {useState}
import GameSection from "./GameSection";


function App() {

    const [randFour, setRandFour] = useState([1,2,3,4]);
    useEffect(() => {
      fetch("http://localhost:8000/message")
        .then((res) => res.json())
        .then((data) => setRandFour(data.randFour));
    }, []);
    //setRandFour(prevPostsData=> ([...prevPostsData, ...data.randFour]));


    return (

        <div>
            <h1>This is 24</h1>
            <GameSection randNumbers = {randFour} setNums={setRandFour} />
            <h1>{randFour}</h1>
        </div>
    );
}

export default App;
